import React from 'react';
function ActionButton({ text, additionalClasses = '', additionalProperties = {}, onClick }) {
  return (
    <button
      id={additionalProperties.id ?? 'button'}
      type={additionalProperties.type ?? 'button'} // Default to 'button' if not specified
      form={additionalProperties.form ?? 'uploadImage'}
      className={`justify-center py-9 pr-20 pl-16 bg-sky-700 rounded-xl border border-black border-solid shadow-md max-md:pr-8 max-md:pl-7 max-md:text-4xl ${additionalClasses}`}
      name="submit"
      onClick={onClick} // Add onClick event handler
      {...additionalProperties} // Spread any additional properties
    >
      {text}
    </button>
  );
};
